import React, { Component } from "react";

import "./Node.css";

export default class Node extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { isFinish, isStart, value } = this.props;
    const extraClassName = isFinish
      ? "node-finish"
      : isStart
      ? "node-start"
      : "";
    return <input className={`node ${extraClassName}`}>{value}</input>;
  }
}

export const DEFAULT_NODE = {
  row: 0,
  col: 0,
};
